  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112763 includes meteorological,
  visual observation and physical data collected aboard the NATHANIEL B. PALMER during
  cruises NBP0103, NBP0104, NBP0202 and NBP0204 in the South Atlantic Ocean and South
  Pacific Ocean from 2001-04-29 to 2002-09-09. These data include ICE - COVERAGE,
  ICE - TYPE, SEDIMENTS - PERCENT COVER, SPECIES IDENTIFICATION - COUNT and precipitation
  type. The instruments used to collect these data include not applicable. These data
  were collected by Christine Ribic of University of Wisconsin and Erik Chapman of
  Old Dominion University as part of Southern Ocean GLOBEC. The Biological and Chemical
  Oceanography Data Management Office (BCO-DMO) submitted these data to NODC on 2013-07-23.nnThe
  following is the text of the abstract provided by BCO-DMO:nnSeabird Survey Effort
  LognThese data are the logistics surrounding the Bird Studies Observations, rather
  than the observations themselves.nPI NOTES:n1. Ice_Cover_Type is based on the ASPeCt
  (Antarctic Sea-Ice Process and Climate) classification system for sea ice and brash.
  Glacial ice listed as bergs or bergy bits.n2. Time and Date can be used in conjunction
  with alongtrack (http:/jg/serv/globec/soglobec/alongtrack.html0) data to find position
  information.nnVisibilitynnCodenDescriptionnn1n>600 mnn2n600 mnn3n>300 mnn4n300 mnn5n<300
